import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";
import "bootstrap/dist/css/bootstrap.min.css";
import ViewPateient from "./components/ViewPatient";
import ViewElderlyPatients from "./components/ViewElderlyPatients";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./components/Home";

ReactDOM.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home />}></Route>
      <Route path="/patients" element={<ViewPateient />}></Route>
      <Route path="/elderlypatients" element={<ViewElderlyPatients />}></Route>
    </Routes>
  </BrowserRouter>,
  document.getElementById("root")
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
